//       ) : (
//         <Redirect to={{ pathname: "/", state: { from: props.location } }} />
//       )
//     }
//   />
// );

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <BrowserRouter history={history}>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/todo" component={Todo} />
            <Redirect from="*" to="/" />
          </Switch>
        </BrowserRouter>
      </div>
    </Provider>
  );
}

export default App;
